def unique(l: list):
    """Return sorted unique elements in a list
    >>> unique([5, 3, 5, 2, 3, 3, 9, 0, 123])
    [0, 2, 3, 5, 9, 123]
    """
    # put(x) - push an element to stack and return top element
    def put(x: int) -> int:
        if x not in l:
            l.append(x)
            return x
        return l.pop()

    # get() - return top of the stack
    def get() -> int:
        return l[-1]

    # first() - return the first element in the stack
    def first() -> int:
        return l[0]

    # build stack, top element is the lowest value
    stack = [0]
    for i in l:
        stack.append(put(i))

    # get elements from stack in reverse order
    return [get() for _ in range(len(stack) - 1, -1, -1)]

