    >>> unique([5, 3, 5, 2, 3, 3, 9, 0, 123])
    [0, 2, 3, 5, 9, 123]
    """
    d = {}
    for n in l:
        if n not in d:
            d[n] = 1
        else:
            d[n] += 1
    return sorted([ k for k, v in d.items() if v == 1 ])

def unique(l: list):
    """Return sorted unique elements in a list
    >>> unique([5, 3, 5, 2, 3, 3, 9, 0, 123])
    [0, 2, 3, 5, 9, 123]
    """
    return sorted(set(l))

